import React, { useState, useContext } from 'react'
import { useNavigate } from 'react-router-dom'
import { AuthContext } from '../contexts/AuthContext'

export default function Login(){
  const [email,setEmail] = useState('')
  const [password,setPassword] = useState('')
  const [err,setErr] = useState(null)
  const [loading,setLoading] = useState(false)
  const { login } = useContext(AuthContext)
  const nav = useNavigate()

  const submit = async e =>{
    e.preventDefault()
    setErr(null)
    setLoading(true)
    try{
      await login(email,password)
      nav('/dashboard')
    }catch(error){
      setErr(error?.response?.data?.message || error?.message || 'Login failed')
    }finally{
      setLoading(false)
    }
  }

  const goSignup = () => {
    nav('/signup')
  }

  return (
    <div className="min-h-screen flex items-center justify-center" style={{background: '#f3f6ff'}}>
      <div className="w-full max-w-md mx-4 p-8 rounded-2xl shadow-xl bg-white" style={{textAlign:'center'}}>
        <div style={{display:'flex', flexDirection:'column', alignItems:'center', gap:12}}>
          <div style={{width:72, height:72, borderRadius:9999, background:'#eef2ff', display:'flex', alignItems:'center', justifyContent:'center'}}>
            <span style={{fontSize:32}}>ðŸ’°</span>
          </div>
          <h1 style={{margin:0, fontSize:26, fontWeight:700, color:'#0b1220'}}>Finarth</h1>
          <p style={{margin:0, color:'#475569'}}>Personal finance made simple</p>
        </div>

        <div style={{marginTop:20, textAlign:'center'}}>
          <h2 style={{margin:0, fontSize:20, fontWeight:600}}>Welcome back</h2>
          <p style={{marginTop:6, color:'#6b7280'}}>Sign in to continue to your dashboard</p>
        </div>

        {err && <div className="mb-3 text-sm text-red-600 bg-red-50 p-2 rounded" style={{marginTop:16}}>{err}</div>}

        <form onSubmit={submit} className="space-y-3" style={{marginTop:18, textAlign:'left'}}>
          <label style={{display:'block', fontSize:12, color:'#374151', marginBottom:6}}>Email</label>
          <input
            value={email}
            onChange={e=>setEmail(e.target.value)}
            placeholder="you@example.com"
            type="email"
            required
            className="w-full p-3 rounded border"
            autoComplete="email"
          />

          <label style={{display:'block', fontSize:12, color:'#374151', marginTop:8, marginBottom:6}}>Password</label>
          <input
            value={password}
            onChange={e=>setPassword(e.target.value)}
            type="password"
            placeholder="Your password"
            required
            className="w-full p-3 rounded border"
            autoComplete="current-password"
          />

          <button type="submit" disabled={loading} className="w-full p-3 rounded-2xl bg-indigo-600 text-white" style={{marginTop:6}}>
            {loading ? 'Signing in...' : 'Sign in'}
          </button>
        </form>

        <div className="mt-4 text-center">
          <p className="text-sm text-gray-600">Don't have an account?</p>
          <button onClick={goSignup} className="mt-2 inline-block text-sm font-medium text-indigo-700 hover:underline">Create an account</button>
        </div>
      </div>
    </div>
  )
}
